import 'package:flutter/material.dart';
import 'book.dart';
import 'book_details.dart';

class BookList extends StatefulWidget {
  const BookList({super.key});

  @override
  State<BookList> createState() => _BookListState();
}

class _BookListState extends State<BookList> {
  List<Book> books = [
    Book(
      "L'histoire de NARUTO",
      "KISHIMOTO",
      "data:image/png;base64,",
    ),
    Book(
      "La recherche du ONE PEACE",
      "ECHIRO ODA",
      "https://via.placeholder.com/150",
    ),
    Book(
      "ICHIGO et l'autre cot du monde spirituel",
      "Bleach",
      "https://via.placeholder.com/150",
    ),
  ];

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: const Text("Liste des livres")),
      body: ListView.builder(
        itemCount: books.length,
        itemBuilder: (context, index) {
          final book = books[index];
          return Card(
            elevation: 5,
            child: ListTile(
              leading: CircleAvatar(
                backgroundImage: NetworkImage(book.imageUrl),
              ),
              title: Text(book.title),
              subtitle: Text(book.author),
              onTap: () {
                Navigator.push(
                  context,
                  MaterialPageRoute(builder: (_) => BookDetails(book: book)),
                );
              },
            ),
          );
        },
      ),
    );
  }
}
